import React from 'react'
import {AiOutlineClose} from 'react-icons/ai'

const Navbar = () => {
  return (
    <div className="flex justify-between items-center h-24 max-w-[1240px] mx-auto px-4 text-[#5E9387]">
      <h1 className="w-full text-3xl font-bold text-[#5E9387]">carbono</h1>
      <ul className="flex">
        <li className="p-4">Home</li>
        <li className="p-4">About</li>
        <li className="p-4">Contact</li>
      </ul>
    </div>
  );
}

export default Navbar
